description:
Gone Girl Soundtrack (aka Gone Girl - Soundtrack From The Motion Picture) was scored by Trent Reznor and Atticus Ross for David Fincher's upcoming film Gone Girl, which is adapted from the bestselling novel by Gillian Flynn. This is the third soundtrack that Reznor and Ross have worked on together, preceded by The Social Network Soundtrack and The Girl With The Dragon Tattoo Soundtrack, also for David Fincher. 


